import Router from 'next/router'
import { useSelector } from 'react-redux';
import AppLayout from '../components/AppLayout';
const Home = () => {
    const{ isLoggedIn, user } = useSelector((state) => state.user);



    //IsNotLoggedIn Render
    if(!isLoggedIn){
        return(
            <>
                <AppLayout>
                <h1>로그인 x</h1>
                </AppLayout>
            </>
        );
    }
    //IsLoggedIn Render
    return(
        <>
            <AppLayout>
                <h1>로그인 o</h1>
            </AppLayout>
        </>
    );
}

export default Home;
